css:
@-moz-document regexp("^http:\\/\\/[^/]+\\.tumblr\\.com\\/archive.*") {
body {
  zoom: 0.8;
}
html,
body,
#nav,
#content .brick {
  background: #000;
}
#content .brick.photo,
#content .brick.video {
  opacity: 0.4;
}
#content .brick.quote {
  background: #fff;
